import React, { Component } from 'react'
import { ContentDiv, Content } from '../styles/SideBarStyles'

export class TodoStacks extends Component {
    // createStack = (name) => {
    //     return <Content key={name.key}>{name.text}</Content>    
    // }
    createTodo(item) {


        return (
            <Content key={item.key}><h2>Name:{item.text[0]}</h2><i>type:{item.text[1]}</i></Content>
        )
    }
    render() {
        var items = this.props.entries;
        var listedItems = items.map(this.createTodo)

            return (
                <React.Fragment>
                    <ContentDiv>
                        {listedItems}
                    </ContentDiv>
                </React.Fragment>
            )
    }
}

    export default TodoStacks
